description:
There's something weird in the Valley. When James and Sean finished their shoot today, double-teaming a hot starlet, a strange spell switched their personalities. Their girlfriends picked up on the out-of-body BS right away. Sarah Blake wants her man like he was before, and Ariella Ferrara would do anything to get her boyfriend's black anaconda back again. 


